import React from 'react';

import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Hangman from './Hangman';


const App = () => (
  <Router>
    <Routes>
      <Route path="/hangman" component={Hangman} />
    </Routes>
  </Router>
)

export default App;
